import React from 'react';
import gallery from './images/gallery.png';
import './App.css';

import './SASS/main.scss';

function App() {
  return (
    <div className='homepage'>
      <div className='aboveFold'>
        <div className='aboveFold_photo'>
          <img
            className='aboveFold_photo'
            src={gallery}
            className='App-logo'
            alt='logo'
          />
        </div>
        <div className='aboveFold_card'>hi</div>
      </div>
    </div>
  );
}

export default App;
